/*Table structure for table `bai_admins` */

DROP TABLE IF EXISTS `bai_admins`;

CREATE TABLE `bai_admins` (
  `user_id` int(11) unsigned NOT NULL AUTO_INCREMENT COMMENT '用户的自增id',
  `username` varchar(64) NOT NULL DEFAULT '' COMMENT '用户名',
  `password` varchar(64) NOT NULL DEFAULT '' COMMENT '密码',
  `name` varchar(64) NOT NULL DEFAULT '' COMMENT '姓名',
  `code` varchar(64) NOT NULL DEFAULT '' COMMENT '工号',
  `sex` varchar(4) NOT NULL DEFAULT '' COMMENT '性别：’男’、’女’',
  `position` varchar(64) NOT NULL DEFAULT '' COMMENT '职务',
  `mobile` varchar(64) NOT NULL DEFAULT '' COMMENT '手机',
  `email` varchar(64) NOT NULL DEFAULT '' COMMENT '邮箱',
  `reg_time` datetime NOT NULL DEFAULT '1000-01-01 00:00:00' COMMENT '注册时间',
  `update_time` datetime NOT NULL DEFAULT '1000-01-01 00:00:00' COMMENT '修改时间',
  `last_login_time` datetime NOT NULL DEFAULT '1000-01-01 00:00:00' COMMENT '最后一次登录时间',
  `last_login_ip` varchar(64) NOT NULL DEFAULT '' COMMENT '最后一次登录ip',
  `visit_count` bigint(20) unsigned NOT NULL DEFAULT '0' COMMENT '登录次数',
  `is_allow_login` tinyint(3) NOT NULL DEFAULT '0' COMMENT '是否允许登录，枚举101：1，允许；0，不允许',
  `enable` tinyint(3) NOT NULL DEFAULT '1' COMMENT '是否启用，枚举102：1，启用；0，禁用',
  PRIMARY KEY (`user_id`),
  UNIQUE KEY `uqe_username` (`username`),
  UNIQUE KEY `uqe_code` (`code`)
) ENGINE=InnoDB AUTO_INCREMENT=3 DEFAULT CHARSET=utf8 ROW_FORMAT=COMPACT COMMENT='后台管理系统登录用户表';

