/*Table structure for table `bai_remote_auths` */

DROP TABLE IF EXISTS `bai_remote_auths`;

CREATE TABLE `bai_remote_auths` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT COMMENT '主键',
  `user` varchar(64) NOT NULL DEFAULT '' COMMENT '用户名',
  `password` varchar(64) NOT NULL DEFAULT '' COMMENT '密码',
  `provide` varchar(128) NOT NULL DEFAULT '' COMMENT '用户提供的用途',
  `auths` varchar(8000) NOT NULL DEFAULT '' COMMENT '权限列表，JSON格式，’all’代表所有权限，一般格式如下：：{UsersService : [''Users getUsers(long userId)'',''Users getUsers(String username)'']}',
  PRIMARY KEY (`id`),
  UNIQUE KEY `uqe_ user` (`user`)
) ENGINE=InnoDB AUTO_INCREMENT=3 DEFAULT CHARSET=utf8 COMMENT='服务service远程访问用户表';

