/*Table structure for table `bai_roles` */

DROP TABLE IF EXISTS `bai_roles`;

CREATE TABLE `bai_roles` (
  `role_id` int(11) unsigned NOT NULL AUTO_INCREMENT COMMENT '角色的自增id',
  `role_pid` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '角色的父id',
  `role_name` varchar(64) NOT NULL DEFAULT '' COMMENT '角色名',
  `role_type` varchar(32) NOT NULL DEFAULT 'ROLE_USER' COMMENT '角色类型：ROLE_ADMIN、ROLE_USER',
  `role_desc` varchar(255) NOT NULL DEFAULT '' COMMENT '描述',
  `sort` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '角色显示顺序，数字越大越靠后',
  `leaf` tinyint(3) NOT NULL DEFAULT '0' COMMENT '是否是叶子节点',
  PRIMARY KEY (`role_id`),
  UNIQUE KEY `uqe_role_name` (`role_name`),
  KEY `idx_role_sort` (`sort`)
) ENGINE=InnoDB AUTO_INCREMENT=6 DEFAULT CHARSET=utf8 ROW_FORMAT=COMPACT COMMENT='后台管理系统用户角色表';

